select * from (select * from (select l_orderkey, sum(l_extendedprice*(1-l_discount)) as revenue, o_orderdate, o_shippriority
from (select * from lineitem where ((l_orderkey >= 491013 and l_orderkey< 492480) or (l_orderkey >= 992771 and l_orderkey< 994242) or (l_orderkey >= 1188034 and l_orderkey< 1189536) or (l_orderkey >= 2298756 and l_orderkey< 2300385) or (l_orderkey >= 2435301 and l_orderkey< 2436960) or (l_orderkey >= 2454819 and l_orderkey< 2456452) or (l_orderkey >= 2626945 and l_orderkey< 2628391) or (l_orderkey >= 3459552 and l_orderkey< 3461094) or (l_orderkey >= 4876864 and l_orderkey< 4878311) or (l_orderkey >= 5520453 and l_orderkey< 5521860))
 ) ll,
(select * from orders where ((o_orderkey >= 491648 and o_orderkey< 493091) or (o_orderkey >= 992257 and o_orderkey< 993732) or (o_orderkey >= 1187622 and o_orderkey< 1189127) or (o_orderkey >= 2300005 and o_orderkey< 2301508) or (o_orderkey >= 2435043 and o_orderkey< 2436547) or (o_orderkey >= 2455969 and o_orderkey< 2457504) or (o_orderkey >= 2628103 and o_orderkey< 2629601) or (o_orderkey >= 3459431 and o_orderkey< 3460932) or (o_orderkey >= 4876996 and o_orderkey< 4878466) or (o_orderkey >= 5520384 and o_orderkey< 5521831))
 ) oo,
(select * from customer where ((c_custkey >= 31650 and c_custkey< 31688) or (c_custkey >= 32775 and c_custkey< 32813) or (c_custkey >= 39150 and c_custkey< 39188) or (c_custkey >= 49613 and c_custkey< 49650) or (c_custkey >= 59588 and c_custkey< 59625) or (c_custkey >= 69938 and c_custkey< 69975) or (c_custkey >= 99150 and c_custkey< 99187) or (c_custkey >= 106687 and c_custkey< 106725) or (c_custkey >= 131362 and c_custkey< 131400) or (c_custkey >= 140662 and c_custkey< 140700))
 ) cc
where c_mktsegment = 'BUILDING' and c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate < '1995-03-15' and l_shipdate > '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority) l2 order by revenue desc, o_orderdate) l1 limit 10;
